import React from 'react'
import Stock from '../components/Stock'

const PortfolioStock = props => {
  debugger
  const renderStocks = () => {
    props.stocks.map(stock => {
      return <Stock stockData={stock}/>
    })
  }
  return( 
    <div>
      {renderStocks}
    </div>
  )
}

export default PortfolioStock
